// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./Ownable.sol";

contract FunKid is Ownable{

    mapping(string => uint256)public txTime;
    mapping(string => address)public txSender;
    mapping(string => address)public txReceiver;
    mapping(string => uint256)public txAmount;
    mapping(string => bool)public txStatus;

    event PaymentProcessed(string txId, address sender, address receiver, uint256 amount, uint256 timestamp);

    constructor(){
    }

    function processPayment(string memory txId_, address recepient_, uint256 amount_)public payable {
        require(amount_ == msg.value, "Invalid value sent");
        require(msg.sender != recepient_, "sender can not be receiver");
        require(!txStatus[txId_], "tx id already used");

        txTime[txId_] = block.timestamp;
        txAmount[txId_] = msg.value;
        txReceiver[txId_] = recepient_;
        txSender[txId_] = msg.sender;
        txStatus[txId_] = true;

        _processPayment(payable(recepient_), amount_);
        emit PaymentProcessed(txId_, msg.sender, recepient_, amount_, block.timestamp);
    }

    /**
     * @dev function to transfer native coin to recepient account
     */
    function _processPayment(address payable recepient_, uint256 amount_)private{

        (bool sent, ) = recepient_.call{value: amount_}("");
        require(sent, "Failed to send Ether");

    }

}

